import { Link } from "react-router-dom";

const Hero = () => {
  return (
    <div className="bg-white h-screen flex flex-col justify-center items-center">
      <h1 className="lg:text-9xl md:text-7xl sm:text-5xl text-3xl font-black mb-14">VENGEANCE</h1>
      <button className="border rounded bg-lime-400 font-mono font-bold">ORDER NOW</button>
    </div>
  );
};

export default Hero;
